export default {
    /** Upcoming Launches Spacex */
    getLaunches: () => {
        returnfetch("https://api.spacexdata.com/v3/launches/upcoming")
        .then(res => res.json())
            .catch({ status: 500, message: 'Internal Server Error' });
    }
}
